drawPascalTriangle(padding, canvas.width - 2*padding, canvas.height - 2*padding);
function drawPascalTriangle(padding, width, height) {
    width -= 2*padding;
    height -= 2*padding;
    for (let r = 0; r < height; r++) {
        for (let c = 0; c < width; c++) {
            if (r > 0 && c > 0) {
                const x = c + padding + padding + r;
                const y = c + padding + r;
