                    drawCell(pascal(r+1, c-1), x, y);
                }
            }
        }
    }
}

function drawCell(value, x, y) {
    const baseX = x - padding;
    const baseY = y - padding;
    ctx.fillStyle = "#000";
    ctx.fillRect(baseX, baseY, padding, padding);
    ctx.fillStyle = "green";
